def cap3(inputContig, vvFolder):
    # directory w/ results
    if not os.path.exists(vvFolder):
      os.makedirs(vvFolder)

    # copy original fasta in result directory
    copy_command = ["cp", os.path.normpath(inputContig), os.path.normpath(vvFolder)]
    subprocess.run(copy_command, check=True, capture_output=True)

    for cpContig in os.listdir(vvFolder):
      if cpContig.endswith(".fasta" or ".fa"):
        # run CAP3
        cap3_command = ["cap3", os.path.join(vvFolder,cpContig)]
        subprocess.run(cap3_command, check=True, capture_output=True)
      if not os.path.exists(vvFolder):
        print("####### Fasta file not found")

    for contigs in os.listdir(vvFolder):
        if contigs.endswith(".cap.contigs"):
            sample = contigs.replace(".fasta.cap.contigs","")
            #print(f"####### Assembling sample {sample} with CAP3")

            for singlets in os.listdir(vvFolder):
                if singlets.endswith(".cap.singlets"):

                    cat_command = f"cat {os.path.join(vvFolder,contigs)} {os.path.join(vvFolder,singlets)} >> {os.path.join(vvFolder, f'{sample}_CAP3.fasta')}"
                    #print(cat_command)
                    subprocess.run(cat_command, shell=True, check=True, capture_output=True)

    
    log_files = [os.path.join(vvFolder, file) for file in os.listdir(vvFolder)
                 if file.endswith((".links",".qual",".info",".contigs",".singlets",".ace"))]
    for log_file in log_files:
        os.remove(log_file)
    # remove original fasta file
    os.remove(os.path.join(vvFolder,inputContig))


def filterfasta(vvFolder):
    min_length = 500  

    input_fasta = None
    for fasta in os.listdir(vvFolder):
        if fasta.endswith("_CAP3.fasta"):
            input_fasta = os.path.join(vvFolder, fasta)
            break

    if input_fasta is None:
        print("Fasta file not found")
        return

    temp_fasta = input_fasta + ".temp"

    # Filter & save
    with open(temp_fasta, "w") as output_handle:
        filtered_seqs = (seq for seq in SeqIO.parse(input_fasta, "fasta") if len(seq.seq) >= min_length)
        count = SeqIO.write(filtered_seqs, output_handle, "fasta")

    if count == 0:
        print(f"There is no {min_length} bp found.")

    # re-write original file
    os.replace(temp_fasta, input_fasta)




def renameFasta(vvFolder):
    for fasta in os.listdir(vvFolder):
        if fasta.endswith(".fasta"):
            input_fasta = os.path.join(vvFolder, fasta)
    mod_headers = []

    for i, record in enumerate(SeqIO.parse(input_fasta, "fasta"), start=1):
        # Mod header
        new_id = f"contig_{i:02d}"
        record.id = new_id
        record.description = new_id 

        # Add header
        mod_headers.append(record)

    fastafile = os.path.join
    # Writing in fasta
    with open(input_fasta, "w") as output_handle:
        SeqIO.write(mod_headers, output_handle, "fasta")

