def process_Pfam(vvFolder, hmmProfile, CPU):
    orf_files = glob.glob(os.path.join(vvFolder,  "*_pfam_ORFs.fasta"))
    if not orf_files:
        raise FileNotFoundError("No file with '_pfam_ORFs.fasta' suffix.")
    
    orf_file = orf_files[0]
    output_tsv = orf_file.replace("_pfam_ORFs.fasta", "_hmmsearch.tsv")

    alphabet = pyhmmer.easel.Alphabet.amino()
    with pyhmmer.easel.SequenceFile(orf_file, digital=True, alphabet=alphabet) as seq_file:
        sequences = list(seq_file)

    results = []
    with pyhmmer.plan7.HMMFile(hmmProfile) as hmm_file:
        for hits in pyhmmer.hmmsearch(hmm_file, sequences, cpus=CPU):
            hmm_name = hits.query.name.decode()

            for hit in hits:
                if hit.included:
                    for domain in hit.domains:
                        results.append(ResultHMM(hit.name.decode(), hmm_name, hit.score, domain.env_from, domain.env_to))
    
    #write in tsv
    with open(output_tsv, "w") as out:
         out.write(f"Query_name\tPfam_TargetID\tPfam_Score\tPfam_Start\tPfam_End\n")  
         for result in results:
             out.write(f"{result.query}\t{result.subjID}\t{result.bitscore}\t{result.start}\t{result.end}\n")


    hmm_files = glob.glob(os.path.join(vvFolder, "*_hmmsearch.tsv"))
    if not hmm_files:
        raise FileNotFoundError("No file with '_hmmsearch.tsv' suffix.")
    
    hmm_table_file = hmm_files[0]
    
    data_parser = pd.read_csv(hmm_table_file, sep="\t")

    

    data_parser["QueryID"] = data_parser["Query_name"].str.extract(r"(.*?)_ORF")
    data_parser = data_parser[["QueryID","Query_name","Pfam_TargetID","Pfam_Score","Pfam_Start","Pfam_End"]]
    data_parser["Pfam_Lenght"] = (data_parser["Pfam_End"] - data_parser["Pfam_Start"]).round(2)
    data_parser = (
    data_parser.loc[data_parser.groupby(["Query_name"])["Pfam_Score"].idxmax()]
    .reset_index(drop=True)
    )

    data_parser = pd.merge(data_parser, pfam_metadata, on="Pfam_TargetID", how="left")
    
    data_parser = data_parser[["QueryID","Query_name","Pfam_TargetID","Pfam_Description","Pfam_Type","Pfam_Score","Pfam_Start","Pfam_End","Pfam_Lenght"]]

    hmmFinal = glob.glob(os.path.join(vvFolder,  "*_hmm.csv"))
    hmmPath = hmmFinal[0]
    hmmTable = pd.read_csv(hmmPath, sep=",")
    

    hmmTable = pd.merge(hmmTable, data_parser, on="QueryID", how="left")
    hmmTable["Query_name"] = hmmTable.filter(like="Query_name").bfill(axis=1).iloc[:, 0]
    hmmTable["Sample_name"] = hmmTable.filter(like="Sample_name").bfill(axis=1).iloc[:, 0]
    hmmTable = hmmTable.loc[:, ~hmmTable.columns.str.contains("_x|_y|_z")]
    hmmTable["Pfam_Score"] = hmmTable["Pfam_Score"].round(2)
    cols = ["Sample_name", "Query_name"] + [col for col in hmmTable.columns if col not in ["Query_name", "Sample_name"]]
    hmmTable = hmmTable.reindex(columns=cols)

    # column fullseq
    fasta_pfam = hmmPath.replace("_hmm.csv","_pfam_ORFs.fasta")
    seq_dict = {} # store sequences

    for record in SeqIO.parse(fasta_pfam, "fasta"):
      seq_dict[record.id] = str(record.seq)

    def get_sequence(query_name):
      return seq_dict.get(query_name, None)

    hmmTable['FullSequence'] = hmmTable['Query_name'].apply(get_sequence)

    # Write table
    csv_output_path = hmmPath
    hmmTable.to_csv(csv_output_path, index=False)
    
    os.remove(hmm_table_file)




def generateFasta(vvFolder):

  name_files = glob.glob(os.path.join(vvFolder,  "*_pfam_ORFs.fasta"))
  if not name_files:
        raise FileNotFoundError("No file with '_pfam_ORFs.fasta' suffix.")
  name_file = name_files[0]
  
  output_file = name_file.replace("_pfam_ORFs.fasta","_viralHMM.fasta")

  hmm_files = glob.glob(os.path.join(vvFolder, "*_hmm.csv"))
  if not hmm_files:
    raise FileNotFoundError("No file with '_hmm.csv' suffix.")
    
  hmm_table_file = hmm_files[0]

  fasta_files = glob.glob(os.path.join(vvFolder, "*_CAP3.fasta"))
  if not fasta_files:
    raise FileNotFoundError("No file with '_CAP3.fasta' suffix.")

  fasta_file = fasta_files[0]

  hmmTable = pd.read_csv(hmm_table_file)
  query_names = set(hmmTable['QueryID'])

  def filter_seqs(input_fasta, output_fasta, queries):
    with open(output_fasta, "w") as out:
        for record in SeqIO.parse(input_fasta, "fasta"):
            if record.id in queries:
                SeqIO.write(record, out, "fasta")

  filter_seqs(fasta_file, output_file, query_names)




def blastn(vvFolder, database, CPU):

    fileFasta = os.path.join(vvFolder, "*_viralHMM.fasta")
    viral_files = glob.glob(fileFasta)

    for viral_file in viral_files:
        infile = viral_file
        sample = os.path.basename(viral_file).replace("_viralHMM.fasta", "")
        outfile = os.path.join(vvFolder,sample)

        blastn_input = ["blastn","-query",infile,"-db",database,"-out",f"{outfile}_blastn.tsv","-outfmt",
        "6 qseqid qlen slen qcovs pident evalue stitle","-num_threads",str(CPU),"-max_target_seqs","1"]

        #print("##### BLASTn started!")
        subprocess.run(blastn_input, check=True, capture_output=True)
        


def diamond_blastx(vvFolder, database, CPU, diamond_path):

    fileFasta = os.path.join(vvFolder, "*_viralHMM.fasta")
    viral_files = glob.glob(fileFasta)

    for viral_file in viral_files:
        infile = viral_file
        sample = os.path.basename(viral_file).replace("_viralHMM.fasta", "")
        outfile = os.path.join(vvFolder,sample)

        if diamond_path == "None":

          Dblastx_input = [
          "diamond", "blastx",
          "--db", database,
          "--query", infile,
          "--threads", str(CPU),
          "--outfmt", "6", "qseqid", "qlen", "slen", "qcovhsp", "pident", "evalue", "stitle",
          "--max-target-seqs", "1",
          "--out", f"{outfile}_blastx.tsv"
          ]
          #print("##### Diamond BLASTx started!")

          try:
              # Executa o comando com subprocess.run
              subprocess.run(Dblastx_input, check=True, capture_output=True)
        
          except subprocess.CalledProcessError as e:
              # Captura e exibe informações sobre o erro
              print(f"Error: Diamond BLASTx failed with return code {e.returncode}.")
              print(f"Command output: {e.stdout}")
              print(f"Command error: {e.stderr}")


        else:
          Dblastx_input = [
          diamond_path, "blastx",
          "--db", database,
          "--query", infile,
          "--threads", str(CPU),
          "--outfmt", "6", "qseqid", "qlen", "slen", "qcovhsp", "pident", "evalue", "stitle",
          "--max-target-seqs", "1",
          "--out", f"{outfile}_blastx.tsv"
          ]

          #print("##### Diamond BLASTx started!")
          subprocess.run(Dblastx_input, check=True, capture_output=True)
        

# Função para extrair o nome da espécie
def extract_organism_name(stitle):
    if stitle == "no_hits":
        return ""
    match = re.search(r'\[([^\]]+)\]', stitle)  # Captura texto dentro dos colchetes
    if match:
        return match.group(1)  # Retorna o nome da espécie
    return ""  # Retorna vazio caso não haja nome da espécie



# Final table
def finalTable(vvFolder):

  tables = glob.glob(os.path.join(vvFolder, "*_CAP3.fasta"))
  first_name = tables[0]
  name = os.path.basename(first_name).replace("_CAP3.fasta","")

  ## table BLASTn
  BlastnTable = os.path.join(vvFolder, f"{name}_blastn.tsv")
  # Verifica se o arquivo existe e se não está vazio
  if os.path.exists(BlastnTable) and os.path.getsize(BlastnTable) != 0:
    inputblastn = pd.read_csv(BlastnTable, sep='\t')
  else:
    print(f"The file {BlastnTable} doesn't exist or is empty.")


  ## table BLASTx
  BlastxTable = os.path.join(vvFolder, f"{name}_blastx.tsv")
  # Verifica se o arquivo existe e se não está vazio
  if os.path.exists(BlastxTable) and os.path.getsize(BlastxTable) != 0:
    inputblastx = pd.read_csv(BlastxTable, sep='\t')
  else:
    print(f"The file {BlastxTable} doesn't exist or is empty.")

  if os.path.exists(BlastnTable) and os.path.getsize(BlastnTable) != 0:
    inputblastn.columns = ['QueryID','BLASTn_Qlenght','BLASTn_Slenght','BLASTn_Cover','BLASTn_Ident','BLASTn_evalue','BLASTn_Subject_Title']
    inputblastn = inputblastn.sort_values(by=["QueryID", "BLASTn_evalue", "BLASTn_Ident"], ascending=[True, True, False])
    inputblastn = inputblastn.drop_duplicates(subset="QueryID", keep="first")
    inputblastn = inputblastn.drop_duplicates()
    inputfile = inputblastn
    inputfile["BLASTn_Subject_Title"] = inputfile["BLASTn_Subject_Title"].fillna("no_hits_BLASTn")

  if os.path.exists(BlastxTable) and os.path.getsize(BlastxTable) != 0 and os.path.exists(BlastnTable) and os.path.getsize(BlastnTable) != 0:
    inputblastx.columns = ['QueryID','BLASTx_Qlenght','BLASTx_Slenght','BLASTx_Cover','BLASTx_Ident','BLASTx_evalue','BLASTx_Subject_Title']
    inputblastx = inputblastx.sort_values(by=["QueryID", "BLASTx_evalue", "BLASTx_Ident"], ascending=[True, True, False])
    inputblastx = inputblastx.drop_duplicates(subset="QueryID", keep="first")
    inputblastx = inputblastx.drop_duplicates()
    inputblastx['Organism_Name'] = inputblastx['BLASTx_Subject_Title'].apply(extract_organism_name)
    inputblastx = pd.merge(inputblastx, viral_metadata, on="Organism_Name", how="left")
    inputblastx.columns = ['QueryID','BLASTx_Qlenght','BLASTx_Slenght','BLASTx_Cover','BLASTx_Ident','BLASTx_evalue','BLASTx_Subject_Title', 'BLASTx_Organism_Name', 'BLASTx_Family','BLASTx_GenomeComposition']
    inputfile = inputfile.merge(inputblastx, on='QueryID', how='outer')
    inputfile["BLASTx_Subject_Title"] = inputfile["BLASTx_Subject_Title"].fillna("no_hits_BLASTx")

    virus_condition = inputfile['BLASTx_Organism_Name'].str.contains(r'virus[-\s]?|phage', case=False, na=False)
    inputfile.loc[virus_condition & inputfile['BLASTx_Family'].apply(lambda x: not str(x).strip() if pd.notna(x) else True), 'BLASTx_Family'] = 'UnknownFamily'
    inputfile.loc[virus_condition & inputfile['BLASTx_GenomeComposition'].apply(lambda x: not str(x).strip() if pd.notna(x) else True), 'BLASTx_GenomeComposition'] = 'UnknownComposition'


    inputfile['BLASTx_Family'] = inputfile['BLASTx_Family'].fillna('non-viral')
    inputfile['BLASTx_GenomeComposition'] = inputfile['BLASTx_GenomeComposition'].fillna('non-viral')

  if os.path.exists(BlastxTable) and os.path.getsize(BlastxTable) != 0 and os.path.exists(BlastnTable) and os.path.getsize(BlastnTable) == 0:
    inputblastx.columns = ['QueryID','BLASTx_Qlenght','BLASTx_Slenght','BLASTx_Cover','BLASTx_Ident','BLASTx_evalue','BLASTx_Subject_Title']
    inputblastx['Organism_Name'] = inputblastx['BLASTx_Subject_Title'].apply(extract_organism_name)
    inputblastx = pd.merge(inputblastx, viral_metadata, on="Organism_Name", how="left")
    inputblastx.columns = ['QueryID','BLASTx_Qlenght','BLASTx_Slenght','BLASTx_Cover','BLASTx_Ident','BLASTx_evalue','BLASTx_Subject_Title', 'BLASTx_Organism_Name', 'BLASTx_Family','BLASTx_GenomeComposition']
    inputfile = inputblastx
    inputfile["BLASTx_Subject_Title"] = inputfile["BLASTx_Subject_Title"].fillna("no_hits_BLASTx")


    virus_condition = inputfile['BLASTx_Organism_Name'].str.contains(r'virus[-\s]?|phage', case=False, na=False)
    inputfile.loc[virus_condition & inputfile['BLASTx_Family'].apply(lambda x: not str(x).strip() if pd.notna(x) else True), 'BLASTx_Family'] = 'UnknownFamily'
    inputfile.loc[virus_condition & inputfile['BLASTx_GenomeComposition'].apply(lambda x: not str(x).strip() if pd.notna(x) else True), 'BLASTx_GenomeComposition'] = 'UnknownComposition'


    inputfile['BLASTx_Family'] = inputfile['BLASTx_Family'].fillna('non-viral')
    inputfile['BLASTx_GenomeComposition'] = inputfile['BLASTx_GenomeComposition'].fillna('non-viral')


  # Insert sample name column
  sample_name = f"{name}"
  inputfile['Sample_name'] = sample_name

  # Order cols by 
  if os.path.getsize(BlastxTable) != 0 and os.path.getsize(BlastnTable) != 0:
    inputfile = inputfile[['Sample_name', 'QueryID', 'BLASTx_Qlenght','BLASTx_Slenght','BLASTx_Cover', 'BLASTx_Ident', 'BLASTx_evalue', 'BLASTx_Subject_Title', 'BLASTx_Organism_Name', 'BLASTx_Family', 'BLASTx_GenomeComposition', 'BLASTn_Qlenght', 'BLASTn_Slenght', 'BLASTn_Cover', 'BLASTn_Ident', 'BLASTn_evalue', 'BLASTn_Subject_Title']]

  if os.path.getsize(BlastxTable) != 0 and os.path.getsize(BlastnTable) == 0:
    inputfile = inputfile[['Sample_name', 'QueryID', 'BLASTx_Qlenght','BLASTx_Slenght','BLASTx_Cover', 'BLASTx_Ident', 'BLASTx_evalue', 'BLASTx_Subject_Title', 'BLASTx_Organism_Name', 'BLASTx_Family', 'BLASTx_GenomeComposition']]

  if os.path.getsize(BlastxTable) == 0 and os.path.getsize(BlastnTable) != 0:
    raise ValueError("BLASTx file is empty.")

  #### column fullseq
  fasta_cap3 = os.path.join(vvFolder,f"{name}_CAP3.fasta")
  seq_dict = {} # store sequences

  for record in SeqIO.parse(fasta_cap3, "fasta"):
    seq_dict[record.id] = str(record.seq)

  def get_sequence(query_name):
   return seq_dict.get(query_name, None)

  inputfile['FullSeq'] = inputfile['QueryID'].apply(get_sequence)

  csv_output_path = os.path.join(vvFolder, f"{name}_all-BLAST.csv")
  inputfile.to_csv(csv_output_path, index=False)

  #####
  # best viral hits table
  viralSeqs = inputfile[inputfile["BLASTx_Family"] != "non-viral"]

  viralSeqs_path = os.path.join(vvFolder, f"{name}_viral-BLAST.csv")
  viralSeqs.to_csv(viralSeqs_path, index=False)


  # move tables
  mydir = "hit_tables"
  os.makedirs(os.path.join(vvFolder, mydir))
  mydir_path = os.path.join(vvFolder, mydir)
  shutil.move(BlastnTable, mydir_path)
  shutil.move(BlastxTable, mydir_path)
  shutil.move(os.path.join(vvFolder,f"{name}_RVDB.csv"),mydir_path)
  shutil.move(os.path.join(vvFolder,f"{name}_Vfam.csv"),mydir_path)
  shutil.move(os.path.join(vvFolder,f"{name}_EggNOG.csv"),mydir_path)


  ################## CREATE JSON ######################

  def csv_to_json(csv_file_path1, csv_file_path2):

      with open(csv_file_path1, mode='r', encoding='utf-8') as file:
          csv_reader = csv.DictReader(file)
          viral_hits = [row for row in csv_reader]
      
      with open(csv_file_path2, mode='r', encoding='utf-8') as file:
          csv_reader = csv.DictReader(file)
          hmm_hits = [row for row in csv_reader]

      return {"Viral_Hits": viral_hits, "HMM_hits": hmm_hits}

  def parse_orf_fastas(file_path):
      # Process FASTA file
      orf_data_by_code = defaultdict(list)

      for record in SeqIO.parse(file_path, "fasta"):
          header = record.description
          parts = header.split()
          
          contig_full = parts[0]
          if '_ORF.' in contig_full:
              contig = contig_full[:contig_full.index('_ORF.')]
          else:
              contig = contig_full
          
          coordinates_strand = parts[1].replace('[', '').replace(']', '')
          if '(' in coordinates_strand:
              coordinates, strand = coordinates_strand.split('(')
              coordinates = coordinates.strip()
              strand = strand.replace(')', '').strip()
              start, end = map(int, coordinates.split('-'))
          else:
              continue

          additional_info = parts[2:]
          additional_info_dict = {info.split(':')[0]: info.split(':')[1] for info in additional_info}

          orf = {
              'Query_name': contig_full,
              'QueryID': contig,
              'start': start,
              'end': end,
              'strand': strand,
              'sequence': str(record.seq),
              'type': additional_info_dict.get('type'),
              'length': int(additional_info_dict.get('length', 0)),
              'frame': additional_info_dict.get('frame'),
              'start_codon': additional_info_dict.get('start'),
              'stop_codon': additional_info_dict.get('stop')
          }
          
          orf_data_by_code[contig].append(orf)

      return dict(orf_data_by_code)

  def combined_json(csv_file_path1, csv_file_path2, fasta_file_path, output_json_path):
      csv_data = csv_to_json(csv_file_path1, csv_file_path2)
      orf_data = parse_orf_fastas(fasta_file_path)
      
      # Merge results
      combined_data = {**csv_data, "ORF_Data": orf_data}
      
      with open(output_json_path, mode='w', encoding='utf-8') as json_file:
          json.dump(combined_data, json_file, indent=4)

  hmmTable_path = os.path.join(vvFolder,f"{name}_hmm.csv")

  combined_json(
      viralSeqs_path,
      hmmTable_path,
      os.path.join(vvFolder,f'{name}_pfam_ORFs.fasta'),
      os.path.join(vvFolder,f'{name}_bestSeqs.json')
  )
  
  #####################################################

  # move fasta files
  fastaDir = "fasta-files"
  os.makedirs(os.path.join(vvFolder, fastaDir))
  fastaDir_path = os.path.join(vvFolder, fastaDir)

  for fasta_text in os.listdir(vvFolder):
    if fasta_text.endswith(".fasta"):
      shutil.move(os.path.join(vvFolder, fasta_text), fastaDir_path)
     




